import React from 'react';
import './App.css';
import AddUrl from './components/AddUrl'
// import UrlList from './components/UrlList'
import Header from './components/Header'
import SubHeader from '../components/SubHeader'


function App() {

  return (
    <div className="App">
      <Header />
      <SubHeader />
      <AddUrl />
    </div>
  );
}

export default App;
